import React, {useState,useEffect} from 'react';
import Videolist from './components/video_list/video_list';
import Navbar from './components/navbar';
import './components/common.css'
// import Video_visuali from './components/video_visuali';
function App() {
  const [videos, setVideos] = useState([]);

  useEffect(()=>{
    const requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };

    fetch("https://youtube.googleapis.com/youtube/v3/search?part=snippet&maxResults=50&q=iu&key=AIzaSyBobrlrOAiEsXROMGfZIizMewXmtK0iidM", 
    requestOptions
    )
      .then(response => response.json())
      .then(result => setVideos(result.items))
      .catch(error => console.log('error', error));
  },[]);
 return(
  <> 
  <Navbar /> 
  <div className="wrap">
    {/* <Video_visuali videos={videos}/> */}
    <Videolist videos={videos}/>
  </div>
  </>
 )
}

export default App;
